    // we need to put the vertices into a buffer so we can
    // block transfer them to the graphics hardware
    function buffer(arr, object, isTexture) {
        var item = new Object();
        
        item.TPB = gl.createBuffer();
        gl.bindBuffer(gl.ARRAY_BUFFER, item.TPB);
        gl.bufferData(gl.ARRAY_BUFFER,object.vertexPos, gl.STATIC_DRAW);
        item.TPB.itemSize = 3;
        item.TPB.numItems = 1000;

        // a buffer for normals
        item.TNB = gl.createBuffer();
        gl.bindBuffer(gl.ARRAY_BUFFER, item.TNB);
        gl.bufferData(gl.ARRAY_BUFFER, object.vertexNormals, gl.STATIC_DRAW);
        item.TNB.itemSize = 3;
        item.TNB.numItems = 1000;

        // a buffer for indices
        item.IB = gl.createBuffer();
        gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, item.IB);
        gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, object.triangleIndices, gl.STATIC_DRAW);

        if(isTexture) {
            // a buffer for textures
            item.TB = gl.createBuffer();
            gl.bindBuffer(gl.ARRAY_BUFFER, item.TB);
            gl.bufferData(gl.ARRAY_BUFFER, object.vertexTextureCoords, gl.STATIC_DRAW);
            item.TB.itemSize = 2;
            item.TB.numItems = 2000;

            item.CB = gl.createBuffer();
            gl.bindBuffer(gl.ARRAY_BUFFER, item.CB);
            gl.bufferData(gl.ARRAY_BUFFER, object.vertexColors, gl.STATIC_DRAW);
            item.CB.itemSize = 3;
            item.CB.numItems = 2000;
        }

        arr.push(item);
    }
